$lang["Oper::model::desempeno::string_5_carta_terminacion_contrato"] = 'comme';
$lang["Oper::model::desempeno::string_8_carta_terminacion_contrato"] = 'jusqu\'au mois de';
$lang["Oper::model::desempeno::string_10_carta_terminacion_contrato"] = 'constitué de';
$lang["Oper::model::desempeno::string_11_carta_terminacion_contrato"] = 'qui attirent l’attention et qui sont dans l’ordre suivant :';
$lang["Oper::model::desempeno::string_12_carta_terminacion_contrato"] = 'Au mois de';
$lang["Oper::model::desempeno::string_16_carta_terminacion_contrato"] = 'attirer l\'attention pour non-respect de la métrique du mois de';
$lang["Oper::model::desempeno::string_19_carta_terminacion_contrato"] = 'Il est à nouveau réprimandé par l\'Organisation, qui lui envoie par écrit la communication des griefs afin qu\'il puisse offrir des explications sur le non-respect de l\'objectif minimum pour le mois de';
$lang["Oper::model::desempeno::string_20_carta_terminacion_contrato"] = 'car encore une fois, il a obtenu un mauvais résultat.';
$lang["Oper::model::desempeno::string_21_carta_terminacion_contrato"] = 'En raison de cette situation, vous avez répondu par écrit aux réclamations formulées par la Société, en indiquant ce qui suit :';
$lang["Oper::model::desempeno::string_26_carta_terminacion_contrato"] = 'Vous pouvez demander sans frais la réalisation de l\'examen médical de sortie, dans les cinq (5) jours ouvrables suivant la délivrance de ce document, pour lequel vous devez vous présenter dans les installations de';
$lang["Oper::model::desempeno::string_28_carta_terminacion_contrato"] = 'sans rendez-vous et sur présentation de ce document aux adresses suivantes par ville :';
$lang["Oper::model::desempeno::string_29_carta_terminacion_contrato"] = 'Gardez à l\'esprit votre obligation de garder strictement confidentielles les informations que vous avez apprises au cours de votre relation de travail avec la Société et par conséquent vous ne pourrez pas les communiquer à des tiers ou à des concurrents, notamment les secrets professionnels, commerciaux et technologiques tels que les processus, procédures, logiciels. , opérations de systèmes, analyses, études, bases de données, conception et/ou nom des modèles, algorithmes et méthodologies utilisés, schémas commerciaux ou toutes informations à caractère confidentiel';
$lang["Oper::model::desempeno::string_30_carta_terminacion_contrato"] = 'avec les Entités Publiques et/ou Privées avec lesquelles elle est liée pour fournir ses services. Si vous divulguez des informations par quelque moyen que ce soit, pour votre propre bénéfice ou celui de tiers, la Société engagera les actions en justice appropriées contre vous et/ou contre la personne physique ou morale à qui elles ont été portées à la connaissance.';
$lang["Oper::model::desempeno::string_31_carta_terminacion_contrato"] = 'Cordialement,';
$lang["Oper::model::desempeno::string_32_carta_terminacion_contrato"] = 'Page';
$lang["Oper::model::desempeno::argumento_1_carta_terminacion_contrato"] = 'Parce que même si vous essayez de vous justifier par le fait que XXX, la vérité est qu\'en examinant la conformité de l\'opération pour ce mois mentionné, on constate que plus de 58% ont respecté l\'exécution du mois, donc aucune certitude n\'est prise sa version des faits.';
$lang["Oper::model::desempeno::argumento_2_carta_terminacion_contrato"] = 'Parce que vous aviez déjà reçu un retour d\'information formel pour ce type de comportement, vous aviez donc le devoir de prendre les mesures et les comportements nécessaires pour éviter de vous y livrer à nouveau, cependant, vous ne l\'avez pas fait non plus, démontrant le manque d\'engagement à la fois envers le fonctionnement ainsi que les fonctions qui lui sont assignées.';
$lang["Oper::model::desempeno::argumento_3_carta_terminacion_contrato"] = 'Parce que vous avez été embauché et formé pour bien accomplir vos tâches, et dans cet ordre d\'idées, vous avez été obligé de respecter les paramètres de vente établis par l\'Opération et l\'Entreprise Cliente, cependant, pendant trois mois consécutifs. , non, Il l\'a fait, manquant ainsi à son obligation contractuelle principale.';
$lang["Oper::model::desempeno::argumento_4_carta_terminacion_contrato"] = 'Parce que même si vous essayez de vous justifier par le fait que vous étiez incapable, la vérité est que l\'entreprise a réévalué vos paramètres à un pourcentage inférieur, afin que vous puissiez vous y conformer, cependant et malgré les multiples opportunités qui vous ont été offertes. Ils ont porté un toast, pas lui.';
$lang["Oper::model::desempeno::argumento_5_carta_terminacion_contrato"] = 'Parce que avec son manque d\'engagement, il a démontré qu\'il n\'est pas capable de fournir le service selon les normes minimales de qualité établies, cela a affecté sa productivité et, par conséquent, celle de l\'opération, en plus, il a mis en évidence le peu de sens de l\'appartenance qu\'il possédait en raison de son travail et de l\'Organisation.';
$lang["Oper::model::desempeno::argumento_6_carta_terminacion_contrato"] = 'Parce que les paramètres fournis par l\'entreprise sont ceux nécessaires pour fournir un service conforme aux normes de qualité et d\'efficacité établies, qui peuvent être obtenues en remplissant correctement les fonctions, la preuve en est le fait qu\'aujourd\'hui, nombre de nos travailleurs gagnent la variable chaque mois pour l\'excellente performance qu\'ils représentent dans leur travail.';
$lang["Oper::model::desempeno::argumento_7_carta_terminacion_contrato"] = 'Parce que vous avez été embauché et formé pour bien accomplir vos tâches et, dans cette mesure, vous étiez obligé de respecter les seuils et objectifs minimaux pour les indicateurs mentionnés ci-dessus, qui ont été établis pour assurer une fourniture correcte du service Line auquel il appartenait. ; cependant, dans ce cas-ci, ce n’est pas le cas.';
$lang["Oper::model::desempeno::argumento_8_carta_terminacion_contrato"] = 'Car par son non-respect, il a non seulement affecté sa performance personnelle, mais aussi celle de l’opération à laquelle il appartenait.';
$lang["Oper::model::desempeno::argumento_9_carta_terminacion_contrato"] = 'Car par votre comportement, non seulement vous n\'avez pas respecté le Règlement Intérieur du Travail, que vous étiez tenu de respecter dès la signature de votre contrat de travail, mais vous avez également ouvert la voie à d\'éventuels commentaires négatifs de la part du Client Entreprise sur la capacité de le personnel que nous embauchons pour s\'occuper de la ligne, ce qui affecte également la réputation de l\'opération.';
$lang["Oper::model::desempeno::string_6_carta_terminacion_contrato"] = 'entre autres fonctions, répondre aux appels et fournir des conseils corrects et complets aux personnes qui appellent la ligne et demandent des informations sur les produits et services offerts par notre Client Entreprise.';
$lang["Oper::model::desempeno::string_7_carta_terminacion_contrato"] = 'Pour ce faire, vous deviez vous conformer aux exigences établies par la Société pour la fourniture du service, parmi lesquelles le respect des paramètres qui mesurent votre performance, votre qualité et votre efficacité dans l\'exécution de votre travail. Cependant, depuis le mois de';
$lang["Oper::model::desempeno::string_9_carta_terminacion_contrato"] = 'n\'a pas systématiquement respecté ses performances, malgré le fait que l\'entreprise lui a fait des retours à plusieurs reprises pour améliorer ses performances par rapport à ses collègues exerçant des tâches similaires, cependant, dans ce cas, il n\'était pas possible de compter sur son engagement et son objectif de corriger ses performances, et d\'atteindre les résultats attendus dans un délai raisonnable. Pour preuve, nous disposons d\'un suivi d\'amélioration selon la procédure établie dans le';
$lang["Oper::model::desempeno::string_13_carta_terminacion_contrato"] = 'un';
$lang["Oper::model::desempeno::string_17_carta_terminacion_contrato"] = 'où vous étiez censé obtenir un résultat objectif, mais où vous avez obtenu un mauvais résultat pour ce mois. Dans un souci d\'amélioration, les actions correctives suivantes ont été indiquées :';
$lang["Oper::model::desempeno::string_18_carta_terminacion_contrato"] = 'Cependant, le précédent appelle à l\'attention et malgré les multiples retours que son Patron Immédiat lui avait donné pour corriger et améliorer ses performances, au mois de';
$lang["Oper::model::desempeno::string_23_carta_terminacion_contrato"] = 'La Société ne peut pas donner de crédibilité à ses explications, et si elles sont vraies, elle ne les considère pas comme des excuses ou des justifications valables ; d\'une part,';
$lang["Oper::model::desempeno::string_24_carta_terminacion_contrato"] = 'Cette mauvaise performance de leur part s\'est répétitive au fil du temps, tout comme leur réticence à atteindre l\'objectif de performance fixé, ce qui implique une répétition du non-respect de leurs obligations contractuelles, réglementaires et légales envers la Société. C\'est pour le motif ci-dessus que la Société met fin à votre contrat de travail pour juste motif, décision qui deviendra effective au bout de 15 jours calendaires ; Autrement dit, votre dernier jour de travail sera le jour';
$lang["Oper::model::desempeno::string_25_carta_terminacion_contrato"] = 'Nous vous informons que dans les quinze (15) jours ouvrables suivant la réception de cette communication, votre règlement des prestations sociales sera envoyé à l\'adresse email enregistrée par vous dans l\'entreprise et les valeurs qui ressortent en votre faveur seront enregistrées dans votre compte bancaire. Si vous ne recevez pas l\'e-mail, la documentation sera également disponible au siège du service client interne et si vous avez des questions ou des préoccupations concernant votre règlement ou vos paiements de paie, veuillez contacter ACI par e-mail';
